import React, { useState } from 'react';
import './ProductPages.css';

const FramedNotes = ({ addToCart }) => {
  const [selectedSizes, setSelectedSizes] = useState({});

  const framedNotes = [
    {
      id: 1,
      name: 'Small Frame',
      description: 'Premium small frame with currency note (6x8 inch)',
      price: 299,
      image: '/assets/frames/small.jpeg'
    },
    {
      id: 2,
      name: 'Large Frame',
      description: 'Premium large frame with currency note (8x10 inch)',
      price: 399,
      image: '/assets/frames/large.jpeg'
    }
  ];

  const handleSizeSelect = (frameId, sizeIndex) => {
    setSelectedSizes({
      ...selectedSizes,
      [frameId]: sizeIndex
    });
  };

  const handleAddToCart = (frame) => {
    const selectedSizeIndex = selectedSizes[frame.id] || 0;
    const selectedSize = frame.sizes[selectedSizeIndex];

    addToCart({
      name: `${frame.name} - ${selectedSize.size}`,
      price: selectedSize.price,
      description: frame.description,
      category: 'Framed Notes'
    });
    alert(`${frame.name} added to cart!`);
  };

  return (
    <div className="product-page">
      <div className="container">
        <div className="page-header">
          <h1 className="page-title">Framed Notes</h1>
          <p className="page-subtitle">
            Premium frames for your special currency notes. Choose your preferred size!
          </p>
        </div>

        <div className="products-grid">
          {framedNotes.map((frame) => (
            <div key={frame.id} className="product-card">
              <div className="product-image">
                <img src={frame.image} alt={frame.name} style={{height: '120px', width: 'auto', borderRadius: '8px', boxShadow: '0 2px 8px rgba(0,0,0,0.08)'}} />
              </div>
              <div className="product-info">
                <h3 className="product-name">{frame.name}</h3>
                <p className="product-description">{frame.description}</p>
                <div className="product-price">₹{frame.price}</div>
                <button 
                  onClick={() => addToCart({
                    name: frame.name,
                    price: frame.price,
                    description: frame.description,
                    category: 'Framed Notes',
                  })}
                  className="btn btn-primary add-to-cart-btn"
                >
                  Add to Cart
                </button>
              </div>
            </div>
          ))}
        </div>

        <div className="product-info-section" style={{marginTop: '2rem', background: '#f8f9fa', border: '2px dashed #d63384', color: '#d63384'}}>
          <h2 style={{fontSize: '1.5rem', marginBottom: '1rem'}}>Customize Your Frame <span style={{fontSize: '1.2rem'}}>(Coming Soon)</span></h2>
          <p>Want a unique frame style, color, or custom engraving? Our custom frame builder will launch soon! Stay tuned for more ways to personalize your keepsake.</p>
        </div>

        <div className="product-info-section">
          <h2>About Our Framed Notes</h2>
          <div className="info-grid">
            <div className="info-item">
              <h3>🎨 Premium Frames</h3>
              <p>High-quality frames made from durable materials with elegant finishes.</p>
            </div>
            <div className="info-item">
              <h3>💎 Special Notes</h3>
              <p>Each frame includes a carefully selected currency note with meaningful serial numbers.</p>
            </div>
            <div className="info-item">
              <h3>🏠 Perfect Display</h3>
              <p>Ideal for home, office, or as a unique gift that tells a story.</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default FramedNotes;
